import { useEffect, useState } from "react";

function Cases() {

  useEffect(() => {
      document.title = 'Cases';
  }, []);

  const [data, setBackendData] = useState([{}]);

  useEffect(() => {
      fetch("/cases").then(
          response => response.json()
      ).then(
          data => {
              setBackendData(data);
          }
      )
  }, []);


    return (
      <section className="section site-portfolio">
        <div className="container">
        <h2 className="cases-header">Cases</h2>
        {data.map(item => {
        return (
            <div id="portfolio-grid" className="mt-3" data-aos="fade-up" data-aos-delay="200" key={item.id}>
            <div className="item web mb-4">
                <a href={`/case-detail/${item.id}`} target="_blank" className="item-wrap fancybox">
                    <div class="work-info">
                    <span>{item.name}</span>
                    <p>{item.category}</p>
                    </div>
                    <img className="img-fluid" src={`/cases-images/`} alt="" />
                </a>
            </div>
        </div>
            )
        })}
        </div>

      </section>
    );
}

export default Cases;
